Sara Albert, born in 1984, is a Davis native and contestant on the wiki:WikiPedia:UPN UPN reality tv series wiki:WikiPedia:America%27s_Next_Top_Model Americas Next Top Model.  She appears as part of the Cycle 6 (March 2006) cast, which consists of 13 contestants.  Albert graduated from Davis Senior High School in 2001, and moved on to obtain a degree in Psychology from Georgetown University in May of 2005.  She currently works in Washington DC as marketing assistant for Advisory Board Co.

